DROP VIEW IF EXISTS `v_mutasi_bankkas`;
CREATE VIEW `v_mutasi_bankkas` AS (select `a`.`mutasi_bankkas_id` AS `mutasi_bankkas_id`,`a`.`mutasi_bankkas_nomor` AS `mutasi_bankkas_nomor`,`a`.`mutasi_bankkas_tanggal` AS `mutasi_bankkas_tanggal`,`a`.`mutasi_bankkas_tipe` AS `mutasi_bankkas_tipe`,if((`a`.`mutasi_bankkas_tipe` = 1),'Mutasi Bank ke Kas',if((`a`.`mutasi_bankkas_tipe` = 2),'Mutasi Bank ke Kas','Mutasi Bank ke Bank')) AS `mutasi_bankkas_tipe_nama`,if((`a`.`mutasi_bankkas_tipe` = 1),`b`.`bank_nama`,if((`a`.`mutasi_bankkas_tipe` = 2),`d`.`kas_nama`,`b`.`bank_nama`)) AS `mutasi_bankkas_dari`,if((`a`.`mutasi_bankkas_tipe` = 1),`h`.`kas_nama`,if((`a`.`mutasi_bankkas_tipe` = 2),`f`.`bank_nama`,`f`.`bank_nama`)) AS `mutasi_bankkas_ke`,if((`a`.`mutasi_bankkas_tipe` = 1),`c`.`cabang_id`,`e`.`cabang_id`) AS `cabang_id`,if((`a`.`mutasi_bankkas_tipe` = 1),`c`.`cabang_nama`,`e`.`cabang_nama`) AS `cabang_nama`,`a`.`mutasi_bankkas_nominal` AS `mutasi_bankkas_nominal` from ((((((((`t_mutasi_bankkas` `a` left join `m_bank` `b` on((`b`.`bank_id` = `a`.`mutasi_bankkas_refrensi_id1`))) left join `m_cabang` `c` on((`c`.`cabang_id` = `b`.`m_cabang_id`))) left join `m_kas` `d` on((`d`.`kas_id` = `a`.`mutasi_bankkas_refrensi_id2`))) left join `m_cabang` `e` on((`e`.`cabang_id` = `d`.`m_cabang_id`))) left join `m_bank` `f` on((`f`.`bank_id` = `a`.`mutasi_bankkas_refrensi_id2`))) left join `m_cabang` `g` on((`g`.`cabang_id` = `f`.`m_cabang_id`))) left join `m_kas` `h` on((`h`.`kas_id` = `a`.`mutasi_bankkas_refrensi_id2`))) left join `m_cabang` `i` on((`i`.`cabang_id` = `h`.`m_cabang_id`)))) ; ;

-- ----------------------------
