us` = 3),'Cek Kredit Limit',if((`a`.`po_customer_status` = 4),'Menunggu Persetujuan',if((`a`.`po_customer_status` = 5),'PO Direvisi',if((`a`.`po_customer_status` = 6),'PO sesuai',if((`a`.`po_customer_status` = 7),'PO Pending',if((`a`.`po_customer_status` = 8),'PO dicancel (Manajer)',if((`a`.`po_customer_status` = 9),'PO disetujui (Manajer)',if((`a`.`po_customer_status` = 10),'PO disetujui (Admin)','Terbit SO')))))))))) AS `po_customer_status_nama` from ((`t_po_customer` `a` join `m_cabang` `b` on((`b`.`cabang_id` = `a`.`m_cabang_id`))) join `m_partner` `c` on((`c`.`partner_id` = `a`.`m_partner_id`)))) ; ;

