-- ----------------------------
DROP VIEW IF EXISTS `v_transfer_gudang`;
CREATE VIEW `v_transfer_gudang` AS select `a`.`transfer_gudang_id` AS `transfer_gudang_id`,`a`.`transfer_gudang_nomor` AS `transfer_gudang_nomor`,`a`.`transfer_gudang_tanggal` AS `transfer_gudang_tanggal`,`b`.`gudang_id` AS `gudang_id_awal`,`b`.`gudang_nama` AS `gudang_nama_awal`,`c`.`cabang_id` AS `cabang_id_awal`,`c`.`cabang_nama` AS `cabang_nama_awal`,`a`.`transfer_gudang_tanggal_terima` AS `transfer_gudang_tanggal_terima`,`d`.`gudang_id` AS `gudang_id_akhir`,`d`.`gudang_nama` AS `gudang_nama_akhir`,`e`.`cabang_id` AS `cabang_id_akhir`,`e`.`cabang_nama` AS `cabang_nama_akhir`,`a`.`transfer_gudang_status` AS `transfer_gudang_status`,if((`a`.`transfer_gudang_status` = 1),'Transfer Gudang Baru',if((`a`.`transfer_gudang_status` = 2),'Transfer Gudang Diterima','Transfer Gudang Ditolak')) AS `transfer_gudang_status_nama`,`a`.`transfer_gudang_created_date` AS `transfer_gudang_created_date`,`a`.`transfer_gudang_created_by` AS `transfer_gudang_created_by`,`a`.`transfer_gudang_update_date` AS `transfer_gudang_update_date`,`a`.`transfer_gudang_update_by` AS `transfer_gudang_update_by`,`a`.`transfer_gudang_revised` AS `transfer_gudang_revised` from ((((`t_transfer_gudang` `a` left join `m_gudang` `b` on((`a`.`m_gudang_id_awal` = `b`.`gudang_id`))) left join `m_cabang` `c` on((`a`.`m_cabang_id_awal` = `c`.`cabang_id`))) left join `m_gudang` `d` on((`a`.`m_gudang_id_akhir` = `d`.`gudang_id`))) left join `m_cabang` `e` on((`a`.`m_cabang_id_akhir` = `e`.`cabang_id`))) ; ;

-- ----------------------------
-- View structure for v_user
-- ----------------------------
DROP VIEW IF EXISTS `v_user`;
CREATE VIEW `v_user` AS select `a`.`user_id` AS `user_id`,`a`.`user_username` AS `user_username`,`b`.`karyawan_id` AS `karyawan_id`,`b`.`karyawan_nama` AS `karyawan_nama`,`a`.`user_status_aktif` AS `user_status_aktif`,if((`a`.`user_status_aktif` = 'y'),'Aktif','Non Aktif') AS `user_status_nama` from (`s_user` `a` left join `m_karyawan` `b` on((`a`.`m_karyawan_id` = `b`.`karyawan_id`))) ; ;
